using Tests

@testset "5.1 Inverse sine" begin
	@test integrate(x^4*asin(a*x), x) == :(sqrt(1 - a^2*x^2)/(5*a^5) - (2*(1 - a^2*x^2)^(3/2))/(15*a^5) + (1 - a^2*x^2)^(5/2)/(25*a^5) + (1/5)*x^5*asin(a*x))
	@test integrate(x^3*asin(a*x), x) == :((3*x*sqrt(1 - a^2*x^2))/(32*a^3) + (x^3*sqrt(1 - a^2*x^2))/(16*a) - (3*asin(a*x))/(32*a^4) + (1/4)*x^4*asin(a*x))
	@test integrate(x^2*asin(a*x), x) == :(sqrt(1 - a^2*x^2)/(3*a^3) - (1 - a^2*x^2)^(3/2)/(9*a^3) + (1/3)*x^3*asin(a*x))
	@test integrate(x^1*asin(a*x), x) == :((x*sqrt(1 - a^2*x^2))/(4*a) - asin(a*x)/(4*a^2) + (1/2)*x^2*asin(a*x))
	@test integrate(x^0*asin(a*x), x) == :(sqrt(1 - a^2*x^2)/a + x*asin(a*x))
	# @test integrate(asin(a*x)/x^1, x, 5) == :(exp((2*I*asin)(a*x))))
	@test integrate(asin(a*x)/x^2, x) == :(-(asin(a*x)/x) - a*atanh(sqrt(1 - a^2*x^2)))
	@test integrate(asin(a*x)/x^3, x) == :(-((a*sqrt(1 - a^2*x^2))/(2*x)) - asin(a*x)/(2*x^2))
	@test integrate(asin(a*x)/x^4, x) == :(-((a*sqrt(1 - a^2*x^2))/(6*x^2)) - asin(a*x)/(3*x^3) - (1/6)*a^3*atanh(sqrt(1 - a^2*x^2)))
	@test integrate(asin(a*x)/x^5, x) == :(-((a*sqrt(1 - a^2*x^2))/(12*x^3)) - (a^3*sqrt(1 - a^2*x^2))/(6*x) - asin(a*x)/(4*x^4))
	@test integrate(asin(a*x)/x^6, x) == :(-((a*sqrt(1 - a^2*x^2))/(20*x^4)) - (3*a^3*sqrt(1 - a^2*x^2))/(40*x^2) - asin(a*x)/(5*x^5) - (3/40)*a^5*atanh(sqrt(1 - a^2*x^2)))
	@test integrate(x^4*asin(a*x)^2, x) == :(-((16*x)/(75*a^4)) - (8*x^3)/(225*a^2) - (2*x^5)/125 + (16*sqrt(1 - a^2*x^2)*asin(a*x))/(75*a^5) + (8*x^2*sqrt(1 - a^2*x^2)*asin(a*x))/(75*a^3) + (2*x^4*sqrt(1 - a^2*x^2)*asin(a*x))/(25*a) + (1/5)*x^5*asin(a*x)^2)
	@test integrate(x^3*asin(a*x)^2, x) == :(-((3*x^2)/(32*a^2)) - x^4/32 + (3*x*sqrt(1 - a^2*x^2)*asin(a*x))/(16*a^3) + (x^3*sqrt(1 - a^2*x^2)*asin(a*x))/(8*a) - (3*asin(a*x)^2)/(32*a^4) + (1/4)*x^4*asin(a*x)^2)
	@test integrate(x^2*asin(a*x)^2, x) == :(-((4*x)/(9*a^2)) - (2*x^3)/27 + (4*sqrt(1 - a^2*x^2)*asin(a*x))/(9*a^3) + (2*x^2*sqrt(1 - a^2*x^2)*asin(a*x))/(9*a) + (1/3)*x^3*asin(a*x)^2)
	@test integrate(x^1*asin(a*x)^2, x) == :(-(x^2/4) + (x*sqrt(1 - a^2*x^2)*asin(a*x))/(2*a) - asin(a*x)^2/(4*a^2) + (1/2)*x^2*asin(a*x)^2)
	@test integrate(x^0*asin(a*x)^2, x) == :(-2*x + (2*sqrt(1 - a^2*x^2)*asin(a*x))/a + x*asin(a*x)^2)
	# @test integrate(asin(a*x)^2/x^1, x, 6, (-(1/3))*I*ArcSin[a*x]^3 + ArcSin[a*x]^2*Log[1 - E^(2*I*ArcSin[a*x])] - I*ArcSin[a*x]*PolyLog[2) == :(exp((2*I*asin)(a*x))))
	# @test integrate(asin(a*x)^2/x^2, x, 7, -(ArcSin[a*x]^2/x) - 4*a*ArcSin[a*x]*ArcTanh[E^(I*ArcSin[a*x])] + 2*I*a*PolyLog[2) == :(exp((I*asin)(a*x))))
	@test integrate(asin(a*x)^2/x^3, x) == :(-((a*sqrt(1 - a^2*x^2)*asin(a*x))/x) - asin(a*x)^2/(2*x^2) + a^2*log(x))
	# @test integrate(asin(a*x)^2/x^4, x, 9, -(a^2/(3*x)) - (a*Sqrt[1 - a^2*x^2]*ArcSin[a*x])/(3*x^2) - ArcSin[a*x]^2/(3*x^3) - (2/3)*a^3*ArcSin[a*x]*ArcTanh[E^(I*ArcSin[a*x])] + (1/3)*I*a^3*PolyLog[2) == :(exp((I*asin)(a*x))))
	@test integrate(asin(a*x)^2/x^5, x) == :(-(a^2/(12*x^2)) - (a*sqrt(1 - a^2*x^2)*asin(a*x))/(6*x^3) - (a^3*sqrt(1 - a^2*x^2)*asin(a*x))/(3*x) - asin(a*x)^2/(4*x^4) + (1/3)*a^4*log(x))
	@test integrate(x^4*asin(a*x)^3, x) == :(-((298*sqrt(1 - a^2*x^2))/(375*a^5)) + (76*(1 - a^2*x^2)^(3/2))/(1125*a^5) - (6*(1 - a^2*x^2)^(5/2))/(625*a^5) - (16*x*asin(a*x))/(25*a^4) - (8*x^3*asin(a*x))/(75*a^2) - (6/125)*x^5*asin(a*x) + (8*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(25*a^5) + (4*x^2*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(25*a^3) + (3*x^4*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(25*a) + (1/5)*x^5*asin(a*x)^3)
	@test integrate(x^3*asin(a*x)^3, x) == :(-((45*x*sqrt(1 - a^2*x^2))/(256*a^3)) - (3*x^3*sqrt(1 - a^2*x^2))/(128*a) + (45*asin(a*x))/(256*a^4) - (9*x^2*asin(a*x))/(32*a^2) - (3/32)*x^4*asin(a*x) + (9*x*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(32*a^3) + (3*x^3*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(16*a) - (3*asin(a*x)^3)/(32*a^4) + (1/4)*x^4*asin(a*x)^3)
	@test integrate(x^2*asin(a*x)^3, x) == :(-((14*sqrt(1 - a^2*x^2))/(9*a^3)) + (2*(1 - a^2*x^2)^(3/2))/(27*a^3) - (4*x*asin(a*x))/(3*a^2) - (2/9)*x^3*asin(a*x) + (2*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(3*a^3) + (x^2*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(3*a) + (1/3)*x^3*asin(a*x)^3)
	@test integrate(x^1*asin(a*x)^3, x) == :(-((3*x*sqrt(1 - a^2*x^2))/(8*a)) + (3*asin(a*x))/(8*a^2) - (3/4)*x^2*asin(a*x) + (3*x*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(4*a) - asin(a*x)^3/(4*a^2) + (1/2)*x^2*asin(a*x)^3)
	@test integrate(x^0*asin(a*x)^3, x) == :(-((6*sqrt(1 - a^2*x^2))/a) - 6*x*asin(a*x) + (3*sqrt(1 - a^2*x^2)*asin(a*x)^2)/a + x*asin(a*x)^3)
	# @test integrate(asin(a*x)^3/x^1, x, 7, (-(1/4))*I*asin(a*x)^4 + asin(a*x)^3*log(1 - exp((2*I*asin)(a*x))) - (3/2)*I*asin(a*x)^2*Polylog(2, E^(2*I*ArcSin[a*x])] + (3/2)*ArcSin[a*x]*PolyLog[3) == :(exp((2*I*asin)(a*x))))
	# @test integrate(asin(a*x)^3/x^2, x, 9, -(asin(a*x)^3/x) - 6*a*asin(a*x)^2*atanh(exp((I*asin)(a*x))) + 6*I*a*asin(a*x)*Polylog(2, -exp((I*asin)(a*x))) - 6*I*a*asin(a*x)*Polylog(2, E^(I*ArcSin[a*x])] - 6*a*PolyLog[3) == :(exp((I*asin)(a*x))))
	# @test integrate(asin(a*x)^3/x^3, x, 7) == :(exp((2*I*asin)(a*x))))
	# @test integrate(asin(a*x)^3/x^4, x, 14, -((a^2*asin(a*x))/x) - (a*sqrt(1 - a^2*x^2)*asin(a*x)^2)/(2*x^2) - asin(a*x)^3/(3*x^3) - a^3*asin(a*x)^2*atanh(exp((I*asin)(a*x))) - a^3*atanh(sqrt(1 - a^2*x^2)) + I*a^3*asin(a*x)*Polylog(2, -exp((I*asin)(a*x))) - I*a^3*asin(a*x)*Polylog(2, E^(I*ArcSin[a*x])] - a^3*PolyLog[3) == :(exp((I*asin)(a*x))))
	# @test integrate(asin(a*x)^3/x^5, x, 10) == :(exp((2*I*asin)(a*x))))
	@test integrate(x^5*asin(a*x)^4, x) == :((245*x^2)/(1152*a^4) + (65*x^4)/(3456*a^2) + x^6/324 - (245*x*sqrt(1 - a^2*x^2)*asin(a*x))/(576*a^5) - (65*x^3*sqrt(1 - a^2*x^2)*asin(a*x))/(864*a^3) - (x^5*sqrt(1 - a^2*x^2)*asin(a*x))/(54*a) + (245*asin(a*x)^2)/(1152*a^6) - (5*x^2*asin(a*x)^2)/(16*a^4) - (5*x^4*asin(a*x)^2)/(48*a^2) - (1/18)*x^6*asin(a*x)^2 + (5*x*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(24*a^5) + (5*x^3*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(36*a^3) + (x^5*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(9*a) - (5*asin(a*x)^4)/(96*a^6) + (1/6)*x^6*asin(a*x)^4)
	@test integrate(x^4*asin(a*x)^4, x) == :((16576*x)/(5625*a^4) + (1088*x^3)/(16875*a^2) + (24*x^5)/3125 - (16576*sqrt(1 - a^2*x^2)*asin(a*x))/(5625*a^5) - (1088*x^2*sqrt(1 - a^2*x^2)*asin(a*x))/(5625*a^3) - (24*x^4*sqrt(1 - a^2*x^2)*asin(a*x))/(625*a) - (32*x*asin(a*x)^2)/(25*a^4) - (16*x^3*asin(a*x)^2)/(75*a^2) - (12/125)*x^5*asin(a*x)^2 + (32*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(75*a^5) + (16*x^2*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(75*a^3) + (4*x^4*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(25*a) + (1/5)*x^5*asin(a*x)^4)
	@test integrate(x^3*asin(a*x)^4, x) == :((45*x^2)/(128*a^2) + (3*x^4)/128 - (45*x*sqrt(1 - a^2*x^2)*asin(a*x))/(64*a^3) - (3*x^3*sqrt(1 - a^2*x^2)*asin(a*x))/(32*a) + (45*asin(a*x)^2)/(128*a^4) - (9*x^2*asin(a*x)^2)/(16*a^2) - (3/16)*x^4*asin(a*x)^2 + (3*x*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(8*a^3) + (x^3*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(4*a) - (3*asin(a*x)^4)/(32*a^4) + (1/4)*x^4*asin(a*x)^4)
	@test integrate(x^2*asin(a*x)^4, x) == :((160*x)/(27*a^2) + (8*x^3)/81 - (160*sqrt(1 - a^2*x^2)*asin(a*x))/(27*a^3) - (8*x^2*sqrt(1 - a^2*x^2)*asin(a*x))/(27*a) - (8*x*asin(a*x)^2)/(3*a^2) - (4/9)*x^3*asin(a*x)^2 + (8*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(9*a^3) + (4*x^2*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(9*a) + (1/3)*x^3*asin(a*x)^4)
	@test integrate(x^1*asin(a*x)^4, x) == :((3*x^2)/4 - (3*x*sqrt(1 - a^2*x^2)*asin(a*x))/(2*a) + (3*asin(a*x)^2)/(4*a^2) - (3/2)*x^2*asin(a*x)^2 + (x*sqrt(1 - a^2*x^2)*asin(a*x)^3)/a - asin(a*x)^4/(4*a^2) + (1/2)*x^2*asin(a*x)^4)
	@test integrate(x^0*asin(a*x)^4, x) == :(24*x - (24*sqrt(1 - a^2*x^2)*asin(a*x))/a - 12*x*asin(a*x)^2 + (4*sqrt(1 - a^2*x^2)*asin(a*x)^3)/a + x*asin(a*x)^4)
	# @test integrate(asin(a*x)^4/x^1, x, 8, (-(1/5))*I*asin(a*x)^5 + asin(a*x)^4*log(1 - exp((2*I*asin)(a*x))) - 2*I*asin(a*x)^3*Polylog(2, exp((2*I*asin)(a*x))) + 3*asin(a*x)^2*Polylog(3, E^(2*I*ArcSin[a*x])] + 3*I*ArcSin[a*x]*PolyLog[4) == :(exp((2*I*asin)(a*x))))
	# @test integrate(asin(a*x)^4/x^2, x, 11, -(asin(a*x)^4/x) - 8*a*asin(a*x)^3*atanh(exp((I*asin)(a*x))) + 12*I*a*asin(a*x)^2*Polylog(2, -exp((I*asin)(a*x))) - 12*I*a*asin(a*x)^2*Polylog(2, exp((I*asin)(a*x))) - 24*a*asin(a*x)*Polylog(3, -exp((I*asin)(a*x))) + 24*a*asin(a*x)*Polylog(3, E^(I*ArcSin[a*x])] - 24*I*a*PolyLog[4) == :(exp((I*asin)(a*x))))
	# @test integrate(asin(a*x)^4/x^3, x, 8, -2*I*a^2*ArcSin[a*x]^3 - (2*a*Sqrt[1 - a^2*x^2]*ArcSin[a*x]^3)/x - ArcSin[a*x]^4/(2*x^2) + 6*a^2*ArcSin[a*x]^2*Log[1 - E^(2*I*ArcSin[a*x])] - 6*I*a^2*ArcSin[a*x]*PolyLog[2) == :(exp((2*I*asin)(a*x))))
	# @test integrate(asin(a*x)^4/x^4, x, 19, -((2*a^2*asin(a*x)^2)/x) - (2*a*sqrt(1 - a^2*x^2)*asin(a*x)^3)/(3*x^2) - asin(a*x)^4/(3*x^3) - 8*a^3*asin(a*x)*atanh(exp((I*asin)(a*x))) - (4/3)*a^3*asin(a*x)^3*atanh(exp((I*asin)(a*x))) + 4*I*a^3*Polylog(2, -exp((I*asin)(a*x))) + 2*I*a^3*asin(a*x)^2*Polylog(2, -exp((I*asin)(a*x))) - 4*I*a^3*Polylog(2, exp((I*asin)(a*x))) - 2*I*a^3*asin(a*x)^2*Polylog(2, exp((I*asin)(a*x))) - 4*a^3*asin(a*x)*Polylog(3, -exp((I*asin)(a*x))) + 4*a^3*asin(a*x)*Polylog(3, E^(I*ArcSin[a*x])] - 4*I*a^3*PolyLog[4) == :(exp((I*asin)(a*x))))
	@test integrate(x^6/asin(a*x), x) == :((5*cosIntegral(asin(a*x)))/(64*a^7) - (9*cosIntegral(3*asin(a*x)))/(64*a^7) + (5*cosIntegral(5*asin(a*x)))/(64*a^7) - cosIntegral(7*asin(a*x))/(64*a^7))
	@test integrate(x^5/asin(a*x), x) == :((5*sinIntegral(2*asin(a*x)))/(32*a^6) - sinIntegral(4*asin(a*x))/(8*a^6) + sinIntegral(6*asin(a*x))/(32*a^6))
