	@test integrate(x^3/asin(a*x), x) == :(sinIntegral(2*asin(a*x))/(4*a^4) - sinIntegral(4*asin(a*x))/(8*a^4))
	@test integrate(x^2/asin(a*x), x) == :(cosIntegral(asin(a*x))/(4*a^3) - cosIntegral(3*asin(a*x))/(4*a^3))
