	# @test integrate(1/(x^2*asin(a*x)), x, 0) == :(x))
	@test integrate(x^6/asin(a*x)^2, x) == :(-((x^6*sqrt(1 - a^2*x^2))/(a*asin(a*x))) - (5*sinIntegral(asin(a*x)))/(64*a^7) + (27*sinIntegral(3*asin(a*x)))/(64*a^7) - (25*sinIntegral(5*asin(a*x)))/(64*a^7) + (7*sinIntegral(7*asin(a*x)))/(64*a^7))
	@test integrate(x^5/asin(a*x)^2, x) == :(-((x^5*sqrt(1 - a^2*x^2))/(a*asin(a*x))) + (5*cosIntegral(2*asin(a*x)))/(16*a^6) - cosIntegral(4*asin(a*x))/(2*a^6) + (3*cosIntegral(6*asin(a*x)))/(16*a^6))
