	@test integrate(x^3/asin(a*x)^3, x) == :(-((x^3*sqrt(1 - a^2*x^2))/(2*a*asin(a*x)^2)) - (3*x^2)/(2*a^2*asin(a*x)) + (2*x^4)/asin(a*x) - sinIntegral(2*asin(a*x))/(2*a^4) + sinIntegral(4*asin(a*x))/a^4)
